export default (function(a,b,c,d,e,f,g,h,i,j,k,l,m){return {data:{ZIbAqI0xWL:{data:{id:2656,attributes:{imdbId:"tt0111478",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMDczNzFiMjktMmJlMy00Y2NkLTlkMzMtN2MwZWE0ODQwOGIzXkEyXkFqcGdeQXVyMDM3ODU0Nw@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.7\u002F10"}],item_lang:{data:{id:3319,attributes:{title:"Traps",plot:"The year is 1950 and an English couple, Louise and Michael, have arrived in French-occupied Indochina to cover a story on a French-owned rubber plantation. They are to be the guests of the enigmatic plantation overseer, Daniel, and his beautiful yet difficult daughter Viola, at their elegant, decaying villa amid a tropical jungle. Michael and Louise hope that some time spent working in an exotic location will help reignite the passion in their floundering marriage. Instead they become unwittingly involved in the personal, sexual and political tensions of their hosts. Daniel is desperate to hold onto a way of life no longer possible in a country struggling for independence, bringing him into conflict with not only his daughter but also with his adopted country.",slug:"traps"}}},books:{data:[{id:12705,attributes:{title:c,description:e,thumbnail:f,authors:[a],firstBook:true,published:g,publisher:h,subtitle:b}},{id:12706,attributes:{title:i,description:j,thumbnail:k,authors:[a],firstBook:d,published:l,publisher:m,subtitle:c}},{id:12707,attributes:{title:i,description:j,thumbnail:k,authors:[a],firstBook:d,published:l,publisher:m,subtitle:c}},{id:12708,attributes:{title:c,description:e,thumbnail:f,authors:[a],firstBook:d,published:g,publisher:h,subtitle:b}},{id:12709,attributes:{title:"Literary Manuscripts",description:"Literary manuscripts of Bearded ladies, Lilian's story and Dreamhouse.",thumbnail:b,authors:[a],firstBook:d,published:"1980-01-01",publisher:b,subtitle:b}}]}}},meta:{}}},prerenderedAt:1680940904894}}("Kate Grenville","","Dreamhouse",null,"It should have been a perfect summer, but for Louise and Rennie their dreamhouse is the stuff of nightmares. Kate Grenville's extraordinary, disturbing novel evokes the mystery and menace underpinning everyday life.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=UDXVBQAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api","2014-12-01","University of Queensland Press","Bearded Ladies","These bearded ladies live on the fringe things, where nothing is quite as it seems. Their beards are invisible, but the women -- and men -- in these highly acclaimed black comedies are just as out of step and out of place as if they were in a side show.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=K6VaAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api","2002-01-01","Macmillan"))